import React from 'react'

export default function Rating(props) {
    const { RatingValue, MaxRating } = props;
    console.log(RatingValue);
    let RatingArr = [];
    for(let i = 0; i < MaxRating; i++) {
        if(i < RatingValue)
            RatingArr.push("checked");
        else
            RatingArr.push("unchecked");
    }
    return (
        RatingArr.map((rating, index) => {
            return rating === "checked" ? (<span className="fa fa-star checked" key = {index}></span>) : (<span key = {index} className="fa fa-star unchecked"></span>); 
        })
    )
}
